import { registerDynImportEntry } from 'js/moduleLoader';
registerDynImportEntry('js/fmsUtils', () => import('js/fmsUtils'));;
export default {
    "openFile": {
        "actionType": "JSFunction",
        "method": "openFile",
        "deps": "js/fmsUtils",
        "inputData": {
            "fileTicket": "{{inputData.fileTicket}}",
            "openFileName": "{{inputData.openFileName}}"
        }
    }
};
